import React from 'react'

export default function Watch() {
  return (
    <div>
       <iframe
          src={process.env.REACT_APP_EMBED_URL}
          width='1000px'
          height='500px'
          title='EthrtainmentLive'
          frameBorder='0'
          scrolling='auto'
          allowFullScreen
          style={{ marginLeft: '250px', marginBottom: '15px' }}
        ></iframe>
    </div>
  )
}
